import React , { Component } from 'react';

class BlogInfo extends Component{
    render() {
        const {title, contents, create_date,id} = this.props.info;
        return(
            <div>
                <div onClick={handleClick}>{id}</div>
                <div>{title}</div>
                <div>{contents}</div>
                <div>{create_date}</div>
            </div>
        )
    }
}

export default BlogInfo;
